import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

const workItems = [
  { id: 'CB-01', image: '/images/CB-01.jpg' },
  { id: 'collage', image: '/images/collage.jpeg' },
  { id: 'Lucky-4', image: '/images/Lucky-4.jpg' },
  { id: 'JungleWrap', image: '/images/JungleWrap.jpg' },
  { id: 'crocos-01', image: '/images/crocos-01.jpg' },
  { id: 'crocos-01', image: '/images/crocos-01.jpg' },
  { id: 'crocos-01', image: '/images/crocos-01.jpg' },
  { id: 'crocos-01', image: '/images/crocos-01.jpg' },
];

function Home() {
  return (
    <div className="grid">
      {workItems.map(item => (
        <div key={item.id} className="grid-item">
          <Link to={`/work/${item.id}`}>
            <img src={item.image} alt={item.title} className="grid-image" />
          </Link>
        </div>
      ))}
    </div>
  );
}

export default Home;
